\u0412\u043e\u043f\u0440\u043e\u0441 30.\u0412\u043e\u043f\u0440\u043e\u0441:
В Таиланде различают много разных видов ИХ. Например, счастливая ОНА;
ОНА, чтобы скрыть печаль или несчастье; ОНА, скрывающая злые намерения;
насмешливая ОНА; сухая ОНА. Назовите мультипликационного персонажа,
которому ОНА помогла преодолеть беспочвенный страх.

\u0412\u043e\u043f\u0440\u043e\u0441 50.\u0412\u043e\u043f\u0440\u043e\u0441:
Прослушайте статистические данные: Лондон, 1870-е годы - 51 день в году;
1880-е годы - 58 дней в году; 1890-е годы - 75 дней в году. О каких днях
идет речь?

\u0412\u043e\u043f\u0440\u043e\u0441 131.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Сасык (Кундук) находится в Одесской области, а озеро Сасык - в Крыму;
для первого озера пишут обычно два названия, чтобы отличать его от
второго.

\u0412\u043e\u043f\u0440\u043e\u0441 207.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Эти сушилки ничего не сушат, а автоматически делают некое подобие суши;
случаи отравления суши в постсоветских странах нередки, ведь толком его
делать не могут.
